メーカー希望小売価格はメーカーカタログに基づいて掲載しています<BR><font size="-1" color="#666666" style="line-height:150%"><br><br>ブランド：Manhattan Portage/マンハッタンポーテージ<BR>商品：Hiking Daypack<BR>サイズ：W24cm H46cm D16cm<BR>カラー：BLACK・NAVY<BR>詳細：大胆な収納構造に拘った新型バックパック。<BR>ダブルジップにより大きく開く間口や大型のサイドポケットには500mlのペットボトルが収納可能のため、シンプルながらも内部へのアクセスの良さと多くの収納を兼ね備える。<BR>・A4、13インチノートPCサイズ収納可能<BR>・サイドポケットに500mlのペットボトルサイズ収納可能<BR>・サイドポケットはL字型ダブルジップ開閉<BR>・大型フロントポケットはB5サイズ収納可能<BR>・ショルダーには肩に優しいパッド入り、滑り止め加工<BR>・背面部パッド入り<BR>・上部に持ち運びしやすいハンドル付き<BR>・背負いのリュックタイプ<BR>　※ノートPC用パットポケットは付属しておりません。</font><style type="text/css">
